import React from "react";
import LoginView from "../../Components/LoginView/loginView";

class Login extends React.Component {
  constructor(props) {
    super(props);
    this.state = {
      email: '',
      password: ''
    }
  }

  render() {
    const { email, password } = this.state;
    let initialValues = {
      email, password
    }
    return (
      <LoginView
        initialValues={initialValues}
      />
    )
  }
}

export default Login;
